Die Sieben-Tage-Inzidenz pro 100 000 Einwohner im Landkreis Freising ist wieder leicht gesunken. Am Mittwoch ist sie vom Landratsamt mit 51,7 angegeben worden (Quelle RKI; Stand 17. Februar). Am Dienstag lag sie laut offiziellen Angaben bei 53,3. Die Differenz zwischen den Werten des LGL und des RKI beruht auf den unterschiedlichen Aktualisierungszeiten der Institute. Seit Beginn der Pandemie im Landkreis sind seit dem 29. Februar 2020 insgesamt 5444 Personen (Stand 17. Februar 2021, 12 Uhr) positiv auf das Coronavirus getestet worden. 106 Menschen sind an oder mit dem Virus verstorben. 5118 Personen sind wieder genesen.
Die erste Impfung haben mittlerweile 5579 Menschen erhalten, die zweite Impfung wurde 3311 Menschen im Landkreis Freising verabreicht. Im Klinikum Freising gibt es derzeit neun Coronafälle, davon muss ein Patient auf der Intensivstation versorgt und dort auch beatmet werden. Verdachtsfälle gibt es mit Stand vom 17. Februar keine
